  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Upper Souris
  National Wildlife Refuge outlines Refuge accomplishments from November of 1941 through
  January of 1942. The narrative starts of with summarizing weather conditions. Wildlife-
  including migratory birds, upland game birds, furbearers, predators, rodents, and
  raptors- are included. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section details recreational
  uses and Refuge visitors. Resource management is described; topics include timber
  removal.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
